import React from "react";
import './App.css';
import Navbar from './Navbar';
import Choice from './Choice'
import Result from './Result'
import Home from './Home'
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  HashRouter,
} from "react-router-dom";

export default function App() {
  const scores=0;
  return (
    <BrowserRouter>
      <HashRouter basename="/">
        <Routes>
          <Route path="/result">
            <Result />
          </Route>
          <Route path="/homeoflove">
            <Home />
          </Route>
          <Route path="/">
          <Choice scores={scores}/>
          </Route>
        </Routes>
      </HashRouter>
    </BrowserRouter>
  );
}
